(1, 'هانى درويش', 'هانى-درويش', 'hany.freestyle4u@gmail.com', NULL, NULL, NULL, '[\"admin\"]', 1, NULL, '$2y$10$6vyfcmJjOFY7sKo9m/ieFO8iPywCaRXNfMAigpFiLS97eQU2wWxme', NULL, NULL, '2024-08-19 03:50:31', '2024-08-19 03:50:31', NULL),
(2, 'Aya', 'Aya', 'm2875650@gmail.com', NULL, NULL, NULL, '[\"editor\"]', 1, NULL, '$2y$10$j/Qa2V0Alm8BCobaTHuibeb.KfKdu11MrzcOql9sgFBEpl.B3.Roy', 'مرحبًا بكم في عالمي، حيث الكلمات ترشدكم إلى فهم أعماق أحلامكم. أنا Aya، المتخصص في تفسير الأحلام وكتابة المقالات المعلوماتية التي تضيء الجوانب المخفية وراء رموز وقصص أحلامنا.\nبخلفية أكاديمية في علم النفس وعلم الاجتماع، أعمق في الأبعاد النفسية والثقافية التي تشكل عوالم أحلامنا. أسعى من خلال كتاباتي لتقديم تحليلات دقيقة ومفهومة، تساعد القراء على ربط تجاربهم الحلمية بواقع حياتهم.\nمن خلال مقالاتي، ستجدون دليلًا شاملًا لفهم الرسائل الخفية في الأحلام وكيفية تطبيق هذه الفهوم في تعزيز النمو الشخصي والوعي الذاتي. انضموا إلي في هذه الرحلة الاستكشافية لعالم الأحلام، حيث كل حلم هو بوابة لاكتشاف الذات.', NULL, '2024-08-19 06:50:31', '2024-08-19 06:50:31', NULL),
